import React, { useEffect } from 'react'


const SendDatas = (props) => {

    const sendDatas = (data) => {
        props.next(data, true)
    }

    useEffect(() => {
        const data = props.datas
        sendDatas(data)
    })

    return (
        <>

        </>
    )
}

export default SendDatas
